import React from "react";
import Todos from "./Todos";

function Table({todos}) {

  return (
    <table className="table">
      <thead>
        <tr>
          <th>Задача</th>
          <th>Статус</th>
          <th>Пользователь ID</th>
        </tr>
      </thead>
      <tbody>
        {todos.map((todo) => (
          <Todos key={todo.id} {...todo} />
        ))}
      </tbody>
    </table>
  );
}

export default Table;
